(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0dea69"],{"870d":function(e){e.exports=JSON.parse('{"name":"Number theory","description":"","items":[{"tags":[{"name":"number theory","url":"/tags/number-theory"}],"title":"NOI-2018 屠龙勇士","excerpt":"小 D 最近在网上发现了一款小游戏。游戏的规则如下：","updated_at":"2022-01-26T22:47:05+08:00","created_at":"2022-01-26T22:47:05+08:00","url":"/docs/number-theory/CRT/luogu-4774"},{"tags":[{"name":"number theory","url":"/tags/number-theory"}],"title":"SDOI-2010 古代猪文","excerpt":"iPig 在大肥猪学校图书馆中查阅资料，得知远古时期猪文文字总个数为 $n$。iPig 打算研究古时某个朝代的猪文文字。根据相关文献记载，那个朝代流传的猪文文字恰好为远古时期的 $1/k$，其中 $k$ 是 $n$ 的一个正约数（可以是 $1$ 或 $n$）。不过具体是哪 $1/k$，以及 $k$ 是多少，由于历史过于久远，已经无从考证了。","updated_at":"2022-01-26T22:47:05+08:00","created_at":"2022-01-26T22:47:05+08:00","url":"/docs/number-theory/Lucas/luogu-2480"},{"tags":[{"name":"number theory","url":"/tags/number-theory"}],"title":"洛谷P3951 小凯的疑惑","excerpt":"小凯手中有两种面值的金币，两种面值均为正整数且彼此互素。每种金币小凯都有无数个。在不找零的情况下，仅凭这两种金币，有些物品他是无法准确支付的。现在小凯想知道在无法准确支付的物品中，最贵的价值是多少金币？注意：输入数据保证存在小凯无法准确支付的商品。","updated_at":"2022-01-26T22:47:05+08:00","created_at":"2022-01-26T22:47:05+08:00","url":"/docs/number-theory/Bezout/luogu-3951"},{"tags":[{"name":"combinatorics","url":"/tags/combinatorics"},{"name":"number theory","url":"/tags/number-theory"}],"title":"HNOI-2009 有趣的数列","excerpt":"我们称一个长度为 $2n$ 的数列是有趣的，当且仅当该数列满足以下三个条件：","updated_at":"2022-01-26T22:47:05+08:00","created_at":"2022-01-26T22:47:05+08:00","url":"/docs/combinatorics/catalan-numbers/luogu-3200"},{"tags":[{"name":"dp","url":"/tags/dp"},{"name":"number theory","url":"/tags/number-theory"}],"title":"CF-980D Perfect Groups","excerpt":"SaMer has written the greatest test case of all time for one of his problems. For a given array of integers, the problem asks to find the minimum number of groups the array can be divided into, such that the product of any pair of integers in the same group is a perfect square.","updated_at":"2022-01-26T22:47:05+08:00","created_at":"2022-01-26T22:47:05+08:00","url":"/docs/acm/dp/cf-980d"}],"url":"/tags/number-theory"}')}}]);
